import React from "react";
import Product from "./Product";

const ProductList = () => {
  const Products = [
    { id: 1, name: "Shoe01" },
    { id: 2, name: "Shoe02" },
    { id: 3, name: "Shoe03" },
    { id: 4, name: "Shoe04" },
    { id: 5, name: "Shoe05" },
    { id: 6, name: "Shoe06" },
    { id: 7, name: "Shoe07" },
    { id: 8, name: "Shoe08" },
  ];

  return (
    <div className="containerTotal">
      {Products.map((item) => (
        <Product key={item.id} id={item.id} name={item.name} />
      ))}
    </div>
  );
};

export default ProductList;
